import React from 'react'

class AddContact extends React.Component{
    render() {
        return (
            <div className="ui main">
                <h2>
                    AddContact
                </h2>
                <form className="ui form">
                    <div className="field">
                        <label>Name</label>
                        <input type="text"></input>
                    </div>
                </form>
            </div>
        );
    }
}

export default AddContact;
